import React from 'react';
import { courses } from '../data/data';

export default function Courses() {
  return (
    <div>
      <h2>Courses</h2>
      <ul>
        {courses.map((course, index) => (
          <li key={index}>
            <strong>{course.title}</strong>: {course.description}
          </li>
        ))}
      </ul>
    </div>
  );
}
